import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import App from "./App";


const Rotas = () => {
   return(
       <Router>
        <Routes>
           <Route path="/" element={<App />}/>
        </Routes>
       </Router>
   )
}

export default Rotas;
